
CREATE TABLE datos_crudos(
  FOLIO VARCHAR(12) NOT NULL PRIMARY KEY
, FECHA VARCHAR(9)
, MONTO NUMERIC(8,2)
, CONCEPTO VARCHAR(41)
, SUBTIPO VARCHAR(1)
, DETALLE VARCHAR(242)
, RAZÓN_SOCIAL VARCHAR(78)
, RFC VARCHAR(18)
, DOMICILIO VARCHAR(111)
, Longitud VARCHAR(21)
, Latitud NUMERIC(11,6)
, FIELD12 VARCHAR(8)
);
